void testChannelZero() {
  size_t numberThreads = 1;
  uint16_t const fileHeight = 5;
  uint16_t const fileWidth = 5;
  uint16_t const fileDepth = 5;
  uint16_t const tileHeight = 2;
  uint16_t const tileWidth = 2;
  uint16_t const tileDepth = 2;

  auto tl = std::make_shared<VirtualFileTileChannelLoader>(
      numberThreads,
      fileHeight, fileWidth, fileDepth,
      tileHeight, tileWidth, tileDepth,
      0);
  auto options = std::make_unique<fl::FastLoaderConfiguration<fl::DefaultView<int>>>(tl);
  options->ordered(true);
  options->borderCreator(fl::FillingType::REPLICATE);
  auto fl = fl::FastLoaderGraph<fl::DefaultView<int >>(std::move(options));

  fl.executeGraph();
  fl.requestAllViews();
  fl.finishRequestingViews();
  fl.waitForTermination();
}

void testBasicChannel() {
  size_t numberThreads = 1;
  uint16_t const fileHeight = 5;
  uint16_t const fileWidth = 5;
  uint16_t const fileDepth = 5;
  uint16_t const tileHeight = 2;
  uint16_t const tileWidth = 2;
  uint16_t const tileDepth = 2;

  std::vector<size_t> const vectorChannels{1, 2, 3};

  for (auto numberChannels : vectorChannels) {
    auto tl = std::make_shared<VirtualFileTileChannelLoader>(
        numberThreads,
        fileHeight, fileWidth, fileDepth,
        tileHeight, tileWidth, tileDepth,
        numberChannels);
    auto options = std::make_unique<fl::FastLoaderConfiguration<fl::DefaultView<int>>>(tl);
    options->ordered(true);
    options->borderCreator(fl::FillingType::REPLICATE);
    auto fl = fl::FastLoaderGraph<fl::DefaultView<int >>(std::move(options));

    fl.executeGraph();
    fl.requestAllViews();
    fl.finishRequestingViews();

    while (auto view = fl.getBlockingResult()) {
      ASSERT_EQ(view->numberChannels(), numberChannels);
      ASSERT_EQ(view->tileHeight(), tileHeight);
      ASSERT_EQ(view->tileWidth(), tileWidth);
      ASSERT_EQ(view->tileDepth(), tileDepth);

      ASSERT_EQ(view->viewHeight(), tileHeight);
      ASSERT_EQ(view->viewWidth(), tileWidth);
      ASSERT_EQ(view->viewDepth(), tileDepth);

      auto startLayer = view->tileLayerIndex() * view->tileDepth();
      auto startRow = view->tileRowIndex() * view->tileHeight();
      auto startCol = view->tileColIndex() * view->tileWidth();

      for (size_t layer = 0; layer < view->realDataDepth(); ++layer) {
        for (size_t row = 0; row < view->realDataHeight(); ++row) {
          for (size_t col = 0; col < view->realDataWidth(); ++col) {
            for (size_t channel = 0; channel < numberChannels; ++channel) {
              ASSERT_EQ(
                  view->viewOrigin()[
                      (layer * tileHeight * tileWidth + row * tileWidth + col) * numberChannels + channel],
                  (int) ((startLayer + layer + 1) * 100 + (startRow + row + 1) * 10 + startCol + col + 1));
            }
          }
        }
      }
      view->returnToMemoryManager();
    }

    fl.waitForTermination();
  }
}

